import React from "react";
import ReactDOM from "react-dom";
import arr,{arr1,arr2 } from "./Mep";
import "./index"; 



const val=arr.map(function (index){
  return index;
});
const val1=arr1.map(function (index1){
  return index1;
});
const val2=arr2.map(function (index2){
  return index2;
});




ReactDOM.render(
  <>
  <span className={styl}>{val}</span><br />
  <span className={styl}>{val1}</span><br />
  <span className={styl}>{val2}</span>
  </>
,document.getElementById('root'));
